import { Box, Center, Flex, Heading, Image, Spacer, Text } from "@chakra-ui/react";
import React from "react";

const Home = () => {
  return (
      <Box id="home" w="100%" h="100%" bg="red.500">
        <Flex p={10}>
          
          <Box w="70%" h="100%" >
          <Box>
            <Heading>Hey ! I'm Shivam</Heading>
            <Text>Full stack web Developer</Text>
          </Box>
          <Spacer></Spacer>
          <Box w="70%">
            <Image
              borderRadius="full"
              boxSize="150px"
              src="https://bit.ly/dan-abramov"
              alt="Dan Abramov"
            />
          </Box>
          </Box>
  
        </Flex>
      </Box>
    
  );
};

export default Home;
